import React, { Component } from "react";
import "./App.css";
class App extends Component {
  constructor(props) {
    super(props);
    this.state = {};
    this.createElement = this.createElement.bind(this);
}
  createElement() {
    const itemList = [
        'Home', 'Home', 'Home', 'Home',
        'Home', 'Home', 'Home', 'Home',
        'Home', 'Home', 'Home', 'Home',
        'Home', 'Home', 'Home'
      ];
      const mapItemList = itemList.map((item, i) => (<button name={"person_" + i}>{item}</button>));
    }

    render() {
    return (
      <div className="App">
        {this.createElement()}
      </div>
    );
  }
}

export default App;
